'''Freygerd''' is a resident of [[Rellekka]], who lives in a house just west of the [[Rellekka mine]], next to the [[sand pit]].

Freygerd, along with her husband, [[Reeso]], play a part in [[The Fremennik Exiles]], where players bring her evidence of [[basilisk]] interlopers in Rellekka by collecting a [[fang]] and [[venom gland]], as well as defeating a [[Basilisk Youngling]] for an [[unsealed letter]].

